import React from 'react'
import Slider from '../../components/Slider/Slider';
import defaultSlides from '../../components/Slider/defaultSlides';

const Slides = () => {
    return (
        <div className='container'>
            <Slider slides={ defaultSlides } />

        </div>
    )
}

export default Slides
